import { useNavigate, Outlet, useLocation, Navigate } from "react-router-dom";
import useAuth from "../hooks/useAuth";

const RequireAuth = () => {
  const location = useLocation();
  const cartCtx = useAuth();
  return (
    cartCtx.adminLogin?<Outlet /> : <></>
  )
};

export default RequireAuth;
